import { Router, NavLink, Switch, Route } from "react-router-dom";

function Navigation() {
  return (
    <div>
      <Router>
        <NavLink>Expenditure</NavLink>
        <NavLink>Transactions</NavLink>
        <Switch>
          <Route></Route>
          <Route></Route>
        </Switch>
      </Router>
    </div>
  );
}

export default Navigation;
